SELECT DISTINCT ?Seed WHERE{ 
	?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/SportsLeague> .
	?Seed 	 <http://dbpedia.org/ontology/campus> 	 ?count . 
} GROUP BY ?Seed 
 HAVING (COUNT(?count) <= 6)

SELECT (COUNT (?Seed) AS ?count) WHERE{
	 ?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/Album> . 
	MINUS{ 
		{?Seed 	 <http://dbpedia.org/ontology/album> 	 <http://dbpedia.org/resource/Graduation_(album)> .} UNION 
		{?Seed 	 <http://dbpedia.org/ontology/producer> 	 <http://dbpedia.org/resource/Kanye_West> .} 
	} 
}

SELECT DISTINCT ?Seed WHERE{ 
	?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/Album> .
	?Seed 	 <http://dbpedia.org/ontology/writer> 	 ?count . 
} GROUP BY ?Seed 
 HAVING (COUNT(?count) >= 2)

SELECT (COUNT (?Seed) AS ?count) WHERE{
	 ?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/Album> . 
	MINUS{ 
		 {{ ?Seed 	 rdf:type 	 <http://dbpedia.org/ontology/Album> .} MINUS{ ?Seed 	 <http://dbpedia.org/ontology/album> 	 <http://dbpedia.org/resource/Graduation_(album)> }} . 
		?Seed 	 <http://dbpedia.org/ontology/producer> 	 <http://dbpedia.org/resource/Kanye_West> . 
	} 
}
